{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n8139dg/28/", "subtitle": "18\u9451\u5b9a", "discourse": ["\u968f\u5206\u3068\u5acc\u305d\u3046\u3060\u306a\u3002\u307e\u3041\u3001\u5206\u304b\u3089\u306a\u3044\u3067\u3082\u306a\u3044\u304c", "\u305d\u3046\u3067\u3059\u306d\u2026\u2026", "\u305d\u3093\u306a\u306b\u5acc\u304b\uff1f", "\u305d\u3046\u3067\u3059\u306d\u3002\u6c17\u306f\u91cd\u3044\u3067\u3059", "\u8a00\u3044\u305f\u304f\u306f\u306a\u3044\u304c\u3001\u3042\u308c\u3060\u3051\u6d3e\u624b\u306b\u66b4\u308c\u305f\u3089\u306a\u3041", "\u66b4\u308c\u305f\u3063\u3066\u3001\u4eba\u805e\u304d\u304c\u60aa\u3044\u3002\u3061\u3087\u3063\u3068\u6cbb\u7642\u3057\u305f\u3060\u3051\u3058\u3083\u306a\u3044\u3067\u3059\u304b", "\u3061\u3087\u3063\u3068\u3058\u3083\u306a\u3044\u3060\u308d\u3046\u3001\u3061\u3087\u3063\u3068\u3058\u3083", "\u9451\u5b9a\u304c\u6e08\u3093\u3060\u304b\u3089\u3063\u3066\u3001\u3059\u3050\u306b\u3069\u3046\u3053\u3046\u3068\u3044\u3046\u3053\u3068\u306f\u306a\u3044\u3068\u306f\u601d\u3046\u304c\u2026\u2026", "\u9b54\u7269\u306e\u6bb2\u6ec5\u2026\u2026\u3001\u6226\u95d8\u306b\u6df7\u3056\u308b\u3093\u3067\u3059\u304b\uff1f", "\u3042\u3041\u3002\u3060\u304c\u9b54\u9053\u5e2b\u306f\u9a0e\u58eb\u306e\u5f8c\u65b9\u3067\u8853\u3092\u767a\u52d5\u3059\u308b\u304b\u3089\u3001\u9a0e\u58eb\u307b\u3069\u5371\u967a\u306a\u76ee\u306b\u306f\u906d\u3044\u306b\u304f\u3044", "\u3067\u3082\u9b54\u7269\u304c\u9b54\u6cd5\u3068\u304b\u4f7f\u3063\u3066\u304d\u305f\u3089\uff1f\u98db\u3093\u3067\u304f\u308b\u3053\u3068\u3082\u3042\u308a\u307e\u3059\u3088\u306d\uff1f", "\u305d\u3046\u3060\u306a\u3002\u5371\u967a\u306a\u76ee\u306b\u307e\u3063\u305f\u304f\u906d\u308f\u306a\u3044\u3068\u306f\u8a00\u3048\u306a\u3044\u306a", "\u79c1\u3082\u4e00\u7dd2\u306b\u53ec\u559a\u3055\u308c\u305f\u5b50\u3082\u3001\u6226\u95d8\u884c\u70ba\u306f\u3057\u305f\u3053\u3068\u306a\u3044\u3093\u3067\u3059\u3051\u3069", "\u6050\u3089\u304f\u4f55\u304b\u3057\u3089\u8a13\u7df4\u3092\u3057\u3066\u304b\u3089\u3060\u308d\u3046\u306a\u3002\u4e00\u7dd2\u306b\u53ec\u559a\u3055\u308c\u305f\u3001\u30a2\u30a4\u30e9\u3060\u3063\u305f\u304b\uff1f\u5f7c\u5973\u3082\u5b66\u5712(\u30a2\u30ab\u30c7\u30df\u30fc)\u3067\u3001\u305d\u3046\u3044\u3046\u3053\u3068\u3092\u5b66\u3093\u3067\u3044\u308b", "\u305d\u3046\u306a\u3093\u3067\u3059\u304b\uff1f", "\u5b66\u5712\u3067\u306f\u8a13\u7df4\u3067\u6771\u306e\u68ee\u306b\u8a0e\u4f10\u306b\u884c\u3063\u305f\u308a\u3059\u308b\u304b\u3089\u306a\u3002\u5f7c\u5973\u3082\u65e2\u306b\u884c\u3063\u305f\u3053\u3068\u304c\u3042\u308b\u306f\u305a\u3060", "\u3082\u3057\u2026\u2026\u3001\u3082\u3057\u3082\u4eca\u65e5\u306e\u9451\u5b9a\u3067\u79c1\u304c\u3010\u8056\u5973\u3011\u3058\u3083\u306a\u3044\u3068\u5206\u304b\u3063\u305f\u3089\u3069\u3046\u306a\u308b\u3093\u3067\u3059\u304b\uff1f", "\u3010\u8056\u5973\u3011\u306e\u4ed5\u4e8b\u306f\u30a2\u30a4\u30e9\u304c\u3084\u308b\u3053\u3068\u306b\u306a\u308b\u3060\u308d\u3046\u3002\u3060\u304c\u2026\u2026", "\u3060\u304c\uff1f", "\u2026\u2026\u304a\u305d\u3089\u304f\u3001\u304a\u524d\u306b\u306f\u652f\u63f4\u8981\u8acb\u304c\u304f\u308b\u3068\u601d\u3046", "\u652f\u63f4\u8981\u8acb\u3067\u3059\u304b\uff1f", "\u4e3b\u306b\u56de\u5fa9\u9b54\u6cd5\u3092\u4f7f\u3063\u3066\u6b32\u3057\u3044\u3068\u3044\u3046\u306a", "\u305d\u306e\u8981\u8acb\u3001\u53d7\u3051\u305f\u3089\u5bae\u5ef7\u9b54\u9053\u5e2b\u56e3\u306b\u7570\u52d5\u3068\u304b\u306b\u306a\u308b\u3093\u3067\u3057\u3087\u3046\u304b\uff1f", "\u3069\u3046\u3060\u308d\u3046\u306a", "\u3067\u304d\u308c\u3070\u7570\u52d5\u306f\u3057\u305f\u304f\u306a\u3044\u3067\u3059", "\u85ac\u7528\u690d\u7269\u7814\u7a76\u6240\u306e\u30f4\u30a1\u30eb\u30c7\u30c3\u30af\u6240\u9577\u3068\u30bb\u30a4\u69d8\u3092\u304a\u9023\u308c\u3044\u305f\u3057\u307e\u3057\u305f", "\u3088\u3046\u3053\u305d\u3001\u5bae\u5ef7\u9b54\u9053\u5e2b\u56e3\u3078\u3002\u79c1\u306f\u5bae\u5ef7\u9b54\u9053\u5e2b\u56e3\u5e2b\u56e3\u9577\u306e\u30e6\u30fc\u30ea\u30fb\u30c9\u30ec\u30f4\u30a7\u30b9\u3067\u3059", "\u30bb\u30a4\u3068\u7533\u3057\u307e\u3059", "\u3042\u3063\u3001\u3068\u3001\u5f7c\u306f\u526f\u5e2b\u56e3\u9577\u306e\u30a8\u30a2\u30cf\u30eb\u30c8\u30fb\u30db\u30fc\u30af\u3002\u4ee5\u524d\u3001\u4f1a\u3063\u305f\u3053\u3068\u3042\u308b\u307f\u305f\u3044\u3060\u3057\u3001\u77e5\u3063\u3066\u307e\u3059\u3088\u306d\uff1f", "\u3048\u3001\u3048\u3047", "\u30a2\u30eb\u306e\u5144\u3060", "\u3055\u3066\u3001\u65e2\u306b\u304a\u4f1d\u3048\u3057\u3066\u3044\u305f\u3068\u304a\u308a\u3001\u4eca\u65e5\u306f\u8cb4\u5973\u306e\u9451\u5b9a\u3092\u3057\u305f\u3044\u3068\u601d\u3044\u307e\u3059", "\u306f\u3044", "\u6c17\u6301\u3061\u3092\u697d\u306b\u3057\u3066\u304f\u3060\u3055\u3044\u306d", "\u305d\u308c\u3058\u3083\u3042\u3001\u3044\u304d\u307e\u3059\u306d", "\u306f\u3044", "\u300e\u9451\u5b9a\u300f", "\u30bb\u30a4\u2026\u2026", "\u62d2\u5426\u3057\u3066\u3044\u307e\u305b\u3093\u3057\u3001\u3061\u3083\u3093\u3068\u62d2\u5426\u3057\u306a\u3044\u3088\u3046\u306b\u6c17\u3092\u3064\u3051\u307e\u3057\u305f\u3088", "\u62d2\u5426\u306f\u3055\u308c\u3066\u306a\u3044\u3093\u3067\u3059\u3088\u306d\uff1f", "\u306f\u3044", "\u62d2\u5426\u3057\u3066\u3044\u306a\u3044\u3068\u306a\u308b\u3068\u3001\u5f8c\u306f\u8cb4\u5973\u306e\u30ec\u30d9\u30eb\u304c\u79c1\u3088\u308a\u9ad8\u3044\u3068\u3044\u3046\u3053\u3068\u304c\u8003\u3048\u3089\u308c\u307e\u3059", "\u306f\u3044", "\u5931\u793c\u3067\u3059\u304c\u3001\u57fa\u790e\u30ec\u30d9\u30eb\u3092\u4f3a\u3063\u3066\u3082\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n8139dg/27/", "subtitle": "\u821e\u53f0\u88cf04-02Another Side\uff08\u5f8c\u7de8\uff09", "discourse": ["\u30ec\u30d9\u30eb\u304c\u4e0a\u304c\u308a\u307e\u3057\u305f", "\u304a\u3081\u3067\u3068\u3046\u3002\u3058\u3083\u3042\u3001\u6b21\u304b\u3089\u306f\u3053\u306e\u9b54\u6cd5\u3092\u4f7f\u3063\u3066\u307f\u3066", "\u4eca\u65e5\u306e\u3068\u3053\u308d\u306f\u3001\u3053\u3053\u307e\u3067\u306b\u3057\u3088\u3046\u304b", "\u306f\u3044", "\u99ac\u8eca\u304c\u6765\u3066\u3044\u306a\u3044\u306a", "\u3061\u3087\u3063\u3068\u3001\u3088\u308d\u3057\u3044\u304b\u3057\u3089\uff1f", "\u79c1(\u308f\u305f\u304f\u3057)\u306f\u30a8\u30ea\u30b6\u30d9\u30b9\u30fb\u30a2\u30b7\u30e5\u30ec\u30a4\u3002\u30ab\u30a4\u30eb\u6bbf\u4e0b\u306e\u5a5a\u7d04\u8005\u3067\u3059\u308f", "\u4ed6\u306e\u65b9\u304b\u3089\u3082\u304a\u4f1d\u3048\u3057\u305f\u3053\u3068\u304c\u3042\u308b\u3068\u306f\u601d\u3044\u307e\u3059\u3051\u3069\u3001\u5a5a\u7d04\u8005\u306e\u3044\u308b\u6bbf\u65b9\u3068\u89aa\u3057\u304f\u306a\u3055\u308b\u306e\u306f\u3001\u3088\u308d\u3057\u304f\u3042\u308a\u307e\u305b\u3093\u308f", "\u3082\u3057\u3001\u8cb4\u5973\u304c\u3088\u308d\u3057\u3051\u308c\u3070\u300c\u4f55\u3092\u3057\u3066\u3044\u308b\uff01\uff01\uff01", "\u30a8\u30ea\u30b6\u30d9\u30b9\u3001\u30a2\u30a4\u30e9\u306b\u4e00\u4f53\u4f55\u306e\u7528\u3060\uff1f", "\u5c11\u3005\u3001\u304a\u8a71\u3092\u3055\u305b\u3066\u3044\u305f\u3060\u3044\u305f\u3060\u3051\u3067\u3059\u308f", "\u8a71\uff1f", "\u3048\u3047", "\u30a2\u30a4\u30e9\u69d8\u306f\u3044\u3064\u3082\u653e\u8ab2\u5f8c\u306f\u6bbf\u4e0b\u9054\u3068\u304a\u52c9\u5f37\u3055\u308c\u3066\u3044\u308b\u3088\u3046\u3067\u3057\u305f\u304b\u3089\u3001\u3088\u308d\u3057\u3051\u308c\u3070\u79c1\u3082\u304a\u624b\u4f1d\u3044\u3067\u304d\u306a\u3044\u304b\u3068\u601d\u3044\u307e\u3057\u3066", "\u5fc5\u8981\u306a\u3044\u3002\u30a2\u30a4\u30e9\u306e\u3053\u3068\u306f\u79c1\u304c\u9762\u5012\u3092\u898b\u308b", "\u3067\u3059\u304c\u6bbf\u4e0b\u2026\u2026", "\u3010\u8056\u5973\u3011\u306b\u3064\u3044\u3066\u306f\u79c1\u306b\u4e00\u4efb\u3055\u308c\u3066\u3044\u308b\u3002\u8a71\u306f\u305d\u308c\u3060\u3051\u304b\uff1f", "\u2026\u2026", "\u3042\u3042\u3001\u3053\u3061\u3089\u306b\u3044\u3089\u3057\u305f\u3093\u3067\u3059\u306d", "\u63a2\u3057\u307e\u3057\u305f\u3088\u3001\u5144\u4e0a", "\u3069\u3046\u3057\u305f\uff1f", "\u30d8\u30eb\u30c4\u30a9\u30fc\u30af\u5148\u751f\u304c\u63a2\u3057\u3066\u3044\u307e\u3057\u305f\u3088", "\u5148\u751f\u304c\uff1f", "\u6765\u9031\u306e\u6771\u306e\u68ee\u3078\u306e\u9060\u5f81\u306b\u3064\u3044\u3066\u3001\u304a\u8a71\u304c\u3042\u308b\u3068\u304b", "\u305d\u3046\u304b", "\u30bf\u30a4\u30df\u30f3\u30b0\u304c\u60aa\u304b\u3063\u305f\u306d", "\u305d\u3046\u3067\u3059\u308f\u306d", "\u300e\u30b9\u30c6\u30fc\u30bf\u30b9\u300f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n8139dg/26/", "subtitle": "\u821e\u53f0\u88cf04-01Another Side\uff08\u524d\u7de8\uff09", "discourse": ["\u8cb4\u5973\u304c\u8056\u5973\u304b\uff1f", "\u3068\u308a\u3042\u3048\u305a\u79fb\u52d5\u3057\u3088\u3046", "\u6539\u3081\u3066\u3001\u79c1\u306f\u3053\u306e\u30b9\u30e9\u30f3\u30bf\u30cb\u30a2\u738b\u56fd\u306e\u7b2c\u4e00\u738b\u5b50\u3067\u3042\u308b\u30ab\u30a4\u30eb\u30fb\u30b9\u30e9\u30f3\u30bf\u30cb\u30a2\u3060\u3002\u8cb4\u5973\u306e\u540d\u524d\u3092\u805e\u3044\u3066\u3082\u826f\u3044\u3060\u308d\u3046\u304b\uff1f", "\u5fa1\u5712\u3001\u611b\u826f\u3067\u3059", "\u3042\u3001\u611b\u826f\u304c\u540d\u524d\u3067\u3059", "\u305d\u3046\u304b\u3001\u30a2\u30a4\u30e9\u306e\u56fd\u3067\u306f\u6211\u304c\u56fd\u3068\u306f\u59d3\u540d\u306e\u9806\u756a\u304c\u7570\u306a\u308b\u306e\u3060\u306a", "\u3042\u306e\u3001\u79c1\u306f\u4f55\u3067\u3053\u3053\u306b\uff1f", "\u6211\u3005\u304c\u8cb4\u5973\u3092\u3010\u8056\u5973\u53ec\u559a\u306e\u5100\u3011\u3067\u53ec\u559a\u3057\u305f", "\u8056\u5973\uff1f", "\u3042\u306e\u2026\u2026\u3001\u305d\u306e\u3001\u9b54\u7269\u3092\u5012\u305b\u3070\u5143\u306e\u4e16\u754c\u306b\u623b\u308c\u308b\u306e\u3067\u3057\u3087\u3046\u304b\uff1f", "\u3044\u3084\u3001\u524d\u306b\u53ec\u559a\u3057\u305f\u8056\u5973\u304c\u5143\u306e\u4e16\u754c\u306b\u623b\u3063\u305f\u3068\u8a00\u3046\u8a71\u306f\u805e\u304b\u306a\u3044\u306a", "\u623b\u308c\u3001\u306a\u3044\u3093\u3067\u3059\u304b\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n8139dg/25/", "subtitle": "17\u672c\u9818\u767a\u63ee", "discourse": ["\u300e\u30d2\u30fc\u30eb\u300f", "\u4f55\u304b\u9055\u548c\u611f\u3068\u304b\u3042\u308a\u307e\u3059\u304b\uff1f", "\u2026\u2026\u2026\u2026\u306a\u3044", "\u30bb\u30a4", "\u3069\u3046\u3057\u307e\u3057\u305f\uff1f", "\u3046\u308f\u3063", "\u2026\u2026\u3042\u308a\u304c\u3068\u3046", "\u3048\u3063\u3068\u3001\u3069\u3046\u3044\u305f\u3057\u307e\u3057\u3066\uff1f", "\u4f55\u3067\u3001\u305d\u3053\u3067\u7591\u554f\u5f62\u306a\u3093\u3060\u3088", "\u3084\u3001\u4f55\u3068\u306a\u304f\u2026\u2026", "\u3042\uff1f", "\u3069\u3046\u3057\u307e\u3057\u305f\uff1f", "\u53e4\u50b7\u307e\u3067\u6cbb\u3063\u3066\u308b", "\u306f\u3044\uff1f", "\u300e\u30a8\u30ea\u30a2\u30d2\u30fc\u30eb\u300f", "\u4eca\u306e\u306f\u2026\u2026\u3001\u7bc4\u56f2\u56de\u5fa9\u304b\uff1f", "\u3048\u3048\u3001\u305d\u3046\u3067\u3059\u3051\u3069\u3002\u6240\u9577\u306f\u3069\u3046\u3057\u3066\u3053\u3053\u306b\uff1f", "\u3069\u3046\u3057\u305f\u3082\u3053\u3046\u3057\u305f\u3082\u3001\u5e30\u308a\u306f\u9045\u3044\u3057\u3001\u7b2c\u4e09\u9a0e\u58eb\u56e3\u306e\u5974\u304c\uff2d\uff30\u30dd\u30fc\u30b7\u30e7\u30f3\u3092\u53d6\u308a\u306b\u304f\u308b\u3057\u3067\u3001\u6c17\u306b\u306a\u3063\u305f\u304b\u3089\u898b\u306b\u6765\u305f\u3093\u3060", "\u3059\u307f\u307e\u305b\u3093\u2026\u2026", "\u305d\u308c\u306b\u3057\u3066\u3082\u3001\u6d3e\u624b\u306b\u3084\u3063\u305f\u3088\u3046\u3060\u306a", "\u3044\u3084\u3001\u305d\u308c\u307b\u3069\u3067\u3082\u2026\u2026", "\u3042\u3041\u3001\u3055\u3063\u304d\u4f1a\u3063\u305f\u304c\u3001\u8155\u3084\u8db3\u3092\u7121\u304f\u3057\u305f\u8005\u9054\u304c\u7686\u6cbb\u3063\u3066\u3044\u305f\u304b\u3089\u306a\u3002\u9a5a\u3044\u305f", "\u307e\u3041\u3001\u3067\u3082\u3001\u3088\u304f\u3084\u3063\u305f\u306a"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n8139dg/24/", "subtitle": "\u9591\u8a7101\u52b4\u50cd\u6642\u9593", "discourse": ["\u5931\u793c\u3057\u307e\u3059", "\u7f8e\u5473\u3057\u305d\u3046\u3060\u306a", "\u4f11\u307f\u306e\u65e5\u3060\u3068\u3044\u3046\u306e\u306b\u3001\u3059\u307e\u306a\u3044\u306a", "\u3044\u3048\u3001\u597d\u304d\u3067\u3057\u3066\u3044\u308b\u3053\u3068\u306a\u306e\u3067\u6c17\u306b\u3057\u306a\u3044\u3067\u304f\u3060\u3055\u3044", "\u3057\u304b\u3057\u3001\u304a\u524d\u672c\u5f53\u306b\u3088\u304f\u50cd\u304f\u306a", "\u305d\u3046\u3067\u3059\u304b\uff1f", "\u4f11\u307f\u3060\u3068\u8a00\u3046\u306e\u306b\u3001\u3044\u3064\u3082\u4f55\u51e6\u306b\u3082\u51fa\u304b\u3051\u306a\u3044\u3067\u7814\u7a76\u6240(\u3053\u3053)\u3067\u4f55\u304b\u3057\u3066\u308b\u3060\u308d", "\u3053\u3053\u306b\u4f4f\u3093\u3067\u3044\u307e\u3059\u304b\u3089\u306d\u3002\u4f11\u65e5\u306b\u306f\u8272\u3005\u3068\u5bb6\u4e8b\u3082\u3057\u305f\u3044\u3067\u3059\u3057", "\u5bb6\u4e8b\u4ee5\u5916\u306f\u7814\u7a76\u3057\u3066\u308b\u304b\u56f3\u66f8\u5ba4\u306b\u884c\u3063\u3066\u308b\u3093\u3060\u308d\uff1f\u4ed5\u4e8b\u3057\u3066\u3044\u308b\u306e\u3068\u5909\u308f\u3089\u306a\u3044\u3058\u3083\u306a\u3044\u304b", "\u3067\u3082\u672c\u5f53\u306b\u65e5\u672c\u306b\u3044\u305f\u6642\u3088\u308a\u306f\u50cd\u3044\u3066\u3044\u307e\u305b\u3093\u3088", "\u524d\u306f\u6bce\u65e5\u3001\u671d\u4e09\u3064\u306e\u9418\u304b\u3089\u771f\u591c\u4e2d\u306e\u9418\u307e\u3067\u50cd\u3044\u3066\u3044\u307e\u3057\u305f\u304b\u3089\u306d", "\u306f\uff1f", "\u305d\u306e\u2026\u2026\u3001\u4ed5\u4e8b\u306e\u4e2d\u3067\u591c\u4f1a\u306b\u53c2\u52a0\u3057\u3066\u3044\u305f\u308a\u3068\u304b\u306f\u2026\u2026", "\u306a\u3044\u3067\u3059\u306d\u3002\u79c1\u306f\u5e73\u6c11\u3067\u3057\u305f\u3057", "\u3046\u3061\u306e\u5bb0\u76f8\u4e26\u307f\u306b\u5fd9\u3057\u3044\u3063\u3066\u3001\u3069\u3093\u306a\u5e73\u6c11\u3060", "\u79c1\u306e\u5468\u308a\u306f\u7686\u305d\u3093\u306a\u611f\u3058\u3067\u3057\u305f\u3088\uff1f", "\u6587\u5b98\u306e\u9023\u4e2d\u306f\u4f3c\u305f\u69d8\u306a\u611f\u3058\u3060\u306a", "\u305d\u3046\u306a\u3093\u3067\u3059\u304b\uff1f", "\u3042\u30fc\u3001\u305d\u3046\u8a00\u3048\u3070\u305d\u3046\u3060\u306a", "\u3061\u3087\u3063\u3001\u4f55\u3067\u3059\u304b\u3063\uff1f", "\u3044\u3084\u3001\u3053\u3063\u3061\u306b\u6765\u305f\u6642\u306b\u6bd4\u3079\u305f\u3089\u7dba\u9e97\u306b\u306a\u3063\u305f\u3088\u306a", "\u306f\uff1f\u3044\u304d\u306a\u308a\u4f55\u306a\u3093\u3067\u3059\u304b\uff1f", "\u7814\u7a76\u6240\u306b\u6765\u305f\u5f53\u521d\u306e\u304a\u524d\u306e\u9854\u3001\u5fd9\u3057\u3044\u6642\u306e\u5185\u52d9\u306e\u9023\u4e2d\u306b\u305d\u3063\u304f\u308a\u3060\u3063\u305f\u306a\u3041\u3068\u601d\u3063\u3066\u306a", "\u4eca\u306f\u3059\u3063\u304b\u308a\u30af\u30de\u3082\u53d6\u308c\u305f\u3088\u306a\u3041", "\u306a\u3093\u3060\u3001\u30a2\u30eb\u3082\u89e6\u308a\u305f\u304b\u3063\u305f\u306e\u304b\uff1f", "\u9055\u3046\u3063\uff01"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n8139dg/23/", "subtitle": "16\u9b54\u6cd5", "discourse": ["\u75db\u3063", "\u300e\u30d2\u30fc\u30eb\u300f", "\u3053\u3053\u306e\u98df\u4e8b\u306f\u7f8e\u5473\u3057\u3044\u3068\u306f\u805e\u3044\u3066\u3044\u305f\u304c\u3001\u3053\u308c\u307b\u3069\u3060\u3068\u306f\u306a", "\u98df\u304c\u9032\u3093\u3067\u3044\u306a\u3044\u3088\u3046\u3060\u304c\u3001\u5177\u5408\u3067\u3082\u60aa\u3044\u306e\u304b\uff1f", "\u3044\u3048\u3001\u4f53\u8abf\u306f\u554f\u984c\u306a\u3044\u3093\u3067\u3059\u3051\u3069\u2026\u2026", "\u3042\u306e\u2026\u2026\u3001\u3069\u3046\u3057\u3066\u3053\u3061\u3089\u306b\uff1f", "\u5c11\u3057\u3001\u8cb4\u5973\u3068\u8a71\u3092\u3057\u305f\u3044\u3068\u601d\u3063\u3066\u306d", "\u305d\u3001\u305d\u3046\u3067\u3059\u304b", "\u307e\u305f\u6765\u308b", "\u3053\u3093\u306b\u3061\u306f\uff5e", "\u304a\u30fc\u3001\u30bb\u30a4\u3058\u3083\u306a\u3044\u304b", "\u4f53\u8abf\u306f\u3044\u304b\u304c\u3067\u3059\u304b\uff1f", "\u3053\u306e\u901a\u308a\u3001\u5143\u6c17\u5143\u6c17", "\u4f55\u8a00\u3063\u3066\u308b\u3093\u3060\u3001\u623b\u3063\u3066\u6765\u305f\u6642\u306f\u6b7b\u306b\u305d\u3046\u306a\u9854\u3057\u3066\u305f\u304f\u305b\u306b", "\u3046\u308b\u305b\u30fc\u305e", "\u5927\u5909\u3060\u3063\u305f\u3093\u3067\u3059\u306d", "\u305d\u308c\u3067\u3082\u3001\u751f\u304d\u3066\u5e30\u308c\u305f\u3060\u3051\u30de\u30b7\u3060\u3063\u305f\u306a", "\u305d\u3046\u305d\u3046\u3001\u30bb\u30a4\u306e\u30dd\u30fc\u30b7\u30e7\u30f3\u306e\u304a\u9670\u3060\u3088", "\u30dd\u30fc\u30b7\u30e7\u30f3\u304c\u5f79\u306b\u7acb\u3063\u305f\u3093\u306a\u3089\u826f\u304b\u3063\u305f\u3067\u3059", "\u304a\u3063\u3001\u898b\u821e\u3044\u306b\u6765\u3066\u304f\u308c\u305f\u306e\u304b\uff1f", "\u305d\u306e\u8155\u2026\u2026", "\u304a\u3045\u3001\u30d8\u30de\u3084\u3063\u3061\u307e\u3063\u3066\u306a", "\u30dd\u30fc\u30b7\u30e7\u30f3\u3067\u6cbb\u305b\u306a\u3044\u3068\u306a\u308b\u3068\u3001\u5f8c\u306f\u56de\u5fa9\u9b54\u6cd5\u3067\u6cbb\u3059\u3093\u3067\u3057\u305f\u3063\u3051\uff1f", "\u3046\u3093\u3001\u307e\u3041\u305d\u3046\u306a\u3093\u3060\u3051\u3069\u306a\u3041", "\u4f55\u304b\u554f\u984c\u304c\u3042\u308b\u3093\u3067\u3059\u304b\uff1f", "\u56de\u5fa9\u9b54\u6cd5\u3067\u3082\u306a\u3041\u3001\u6b20\u640d\u3092\u6cbb\u3059\u306e\u306f\u96e3\u3057\u3044\u3093\u3060\u3088", "\u3044\u306a\u3044\u3093\u3067\u3059\u304b\uff1f", "\u5143\u3005\u3001\u9b54\u9053\u5e2b\u306e\u4e2d\u3067\u3082\u8056\u5c5e\u6027\u9b54\u6cd5\u304c\u4f7f\u3048\u308b\u5974\u306f\u5c11\u306a\u3044\u3093\u3060", "\u6b62\u8840\u306b\u30dd\u30fc\u30b7\u30e7\u30f3\u304c\u4f7f\u3048\u305f\u3060\u3051\u3067\u3082\u826f\u304b\u3063\u305f\u3055\u3002\u3058\u3083\u306a\u304d\u3083\u3001\u706b\u3067\u7099\u308b\u7fbd\u76ee\u306b\u306a\u3063\u305f\u3060\u308d\u3046\u304b\u3089\u306a", "\u4eca\u65e5\u306f\u6765\u3066\u304f\u308c\u3066\u3042\u308a\u304c\u3068\u306a\u3002\u6700\u5f8c\u306b\u4f1a\u3048\u3066\u826f\u304b\u3063\u305f", "\u3048\uff1f\u6700\u5f8c\uff1f", "\u52d5\u3051\u308b\u3088\u3046\u306b\u306a\u3063\u305f\u3089\u3001\u9a0e\u58eb\u56e3\u3092\u8f9e\u3081\u3066\u6545\u90f7\u306b\u5e30\u308b\u3053\u3068\u306b\u3057\u305f\u3093\u3060\u3002\u3053\u306e\u8155\u3058\u3083\u9a0e\u58eb\u3092\u7d9a\u3051\u308b\u306e\u306f\u96e3\u3057\u3044\u304b\u3089\u306a", "\u3082\u3057\u2026\u2026\u3002\u3082\u3057\u3082\u8155\u304c\u6cbb\u308b\u3068\u3057\u305f\u3089\u3001\u6cbb\u3057\u305f\u3044\u3067\u3059\u304b\uff1f", "\u305d\u308c\u306f\u2026\u2026"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n8139dg/22/", "subtitle": "15\u6700\u521d\u306e\u4e00\u6b69", "discourse": ["\u304a\u3044\u304a\u3044\u3001\u968f\u5206\u6c17\u5408\u5165\u308c\u3066\u4f5c\u3063\u3066\u308b\u306a", "\u3059\u307f\u307e\u305b\u3093\u3001\u8003\u3048\u4e8b\u3092\u3057\u3066\u305f\u3089\u4f5c\u308a\u904e\u304e\u3061\u3083\u3044\u307e\u3057\u305f", "\u307e\u3060\u307e\u3060\u4f59\u88d5\u305d\u3046\u3060\u306a\u3002\u4eca\u65e5\u3060\u3051\u3067\u3053\u306e\u500d\u306f\u3044\u3051\u308b\u304b\uff1f", "\u305d\u3046\u3067\u3059\u306d\u3002\u305d\u308c\u4f4d\u306a\u3089\u307e\u3060\u4f59\u88d5\u3067\u3059\u306d", "\u8056\u5c5e\u6027\u9b54\u6cd5", "\u9b54\u6cd5\u306b\u8208\u5473\u304c\u3042\u308b\u306e\u304b\u3044\uff1f", "\u305d\u306e\u672c\u306f\u975e\u5e38\u306b\u5185\u5bb9\u304c\u96e3\u3057\u304b\u3063\u305f\u3068\u601d\u3046\u304c\u2026\u2026", "\u305d\u3046\u3001\u3067\u3059\u306d\u3002\u3067\u304d\u308c\u3070\u3001\u3082\u3046\u5c11\u3057\u7c21\u5358\u306a\u7269\u304c\u826f\u304b\u3063\u305f\u306a\u3068\u601d\u3063\u3066\u3044\u305f\u3068\u3053\u308d\u3067\u3059", "\u306a\u3089\u3001\u3053\u3061\u3089\u306e\u65b9\u304c\u826f\u3044\u3060\u308d\u3046", "\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u3044\u3084", "\u540d\u4e57\u308b\u306e\u304c\u9045\u304f\u306a\u3063\u305f\u3002\u79c1\u306f\u30b8\u30fc\u30af\u30d5\u30ea\u30fc\u30c8\u30fb\u30b9\u30e9\u30f3\u30bf\u30cb\u30a2\u3060", "\u8cb4\u5973\u306e\u540d\u306f\u30bb\u30a4\u3067\u826f\u304b\u3063\u305f\u304b\u306a\uff1f", "\u3048\u3001\u3048\u3047", "\u30bb\u30a4\u3068\u7533\u3057\u307e\u3059", "\u305d\u3093\u306a\u306b\u754f\u307e\u3089\u306a\u304f\u3066\u3044\u3044\u3002\u793c\u3092\u5c3d\u304f\u3055\u306a\u3051\u308c\u3070\u306a\u3089\u306a\u3044\u306e\u306f\u3001\u3053\u3061\u3089\u306a\u306e\u3060\u304b\u3089", "\u8cb4\u5973\u306b\u306f\u606f\u5b50\u304c\u5927\u5909\u306a\u5931\u793c\u3092\u50cd\u3044\u305f\u3068\u805e\u3044\u3066\u3044\u308b\u3002\u611a\u606f\u306e\u3057\u305f\u3053\u3068\u3001\u5927\u5909\u7533\u3057\u8a33\u306a\u3044", "\u606f\u5b50\u3055\u3093\u3067\u3059\u304b\uff1f", "\u3042\u3041", "\u3048\u30fc\u3063\u3068\u3001\u78ba\u304b\u3001\u30ab\u30a4\u30eb\u2026\u2026\u3001\u6bbf\u4e0b\u306e\u3053\u3068\u3067\u3057\u3087\u3046\u304b\uff1f", "\u305d\u3046\u3060", "\u3042\u3001\u982d\u3092\u4e0a\u3052\u3066\u304f\u3060\u3055\u3044\u3063\uff01", "\u3057\u304b\u3057\u2026\u2026", "\u6c17\u306b\u3057\u3066\u307e\u305b\u3093\u304b\u3089\u3063", "\u672c\u6765\u3067\u3042\u308c\u3070\u3001\u3082\u3063\u3068\u65e9\u304f\u3001\u3061\u3083\u3093\u3068\u3057\u305f\u5834\u6240\u3067\u8b1d\u7f6a\u3057\u306a\u3051\u308c\u3070\u3044\u3051\u306a\u304b\u3063\u305f\u306e\u3060\u304c\u2026\u2026\u3002\u3053\u306e\u69d8\u306a\u5834\u6240\u3067\u91cd\u306d\u91cd\u306d\u7533\u3057\u8a33\u306a\u3044", "\u3044\u3084\u3063\u3001\u6c17\u306b\u3057\u306a\u3044\u3067\u304f\u3060\u3055\u3044\u3063\u3002\u3080\u3057\u308d\u3053\u3053\u3067\u306e\u65b9\u304c\u3042\u308a\u304c\u305f\u3044\u3067\u3059", "\u8b1d\u7f6a\u3082\u3060\u304c\u3001\u3053\u306e\u56fd\u306b\u6765\u3066\u304b\u3089\u8cb4\u5973\u306f\u8272\u3005\u306a\u529f\u7e3e\u3092\u6319\u3052\u3066\u3044\u308b\u3002\u4f55\u304b\u6069\u8cde\u3067\u3082\u3068\u601d\u3046\u306e\u3060\u304c\u3001\u6b32\u3057\u3044\u7269\u306f\u306a\u3044\u306e\u304b\uff1f\u9818\u571f\u3068\u304b\u7235\u4f4d\u3068\u304b\u2026\u2026", "\u3044\u3044\u3048\u3001\u7d50\u69cb\u3067\u3059\u3063", "\u305d\u3046\u304b\u3001\u306a\u3089\u3070\u738b\u90fd\u306b\u5c4b\u6577\u3067\u3082\u2026\u2026", "\u305d\u308c\u3082\u7d50\u69cb\u3067\u3059\u3002\u7ba1\u7406\u3067\u304d\u307e\u305b\u3093\u304b\u3089", "\u4f7f\u7528\u4eba\u3082\u3053\u3061\u3089\u3067\u7528\u610f\u3059\u308b\u304c\uff1f", "\u4f7f\u7528\u4eba\u3063\uff01\uff1f", "\u30e8\u30cf\u30f3\u304c\u8a00\u3046\u901a\u308a\u3060\u306a", "\u4ed5\u65b9\u306a\u3044\u3001\u4eca\u306f\u8ae6\u3081\u3088\u3046\u3002\u4f55\u304b\u6b32\u3057\u3044\u7269\u3092\u601d\u3044\u3064\u3044\u305f\u3089\u6559\u3048\u3066\u6b32\u3057\u3044\u3002\u3067\u304d\u308b\u9650\u308a\u7528\u610f\u3059\u308b\u304b\u3089"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n8139dg/21/", "subtitle": "14\u601d\u3046\u3053\u3068", "discourse": ["\u304a\u306f\u3088\u3046\u3001\u30bb\u30a4", "\u8a00\u3063\u3066\u304f\u308c\u308c\u3070\u624b\u4f1d\u3063\u305f\u306e\u306b", "\u3042\u308a\u304c\u3068\u3046\u3002\u6c17\u6301\u3061\u3060\u3051\u53d7\u3051\u53d6\u3063\u3068\u304f\u308f", "\u305d\u3046\u3044\u3048\u3070\u3001\u4eca\u65e5\u3063\u3066\u304a\u5e97\u304b\u3089\u85ac\u8349\u304c\u5c4a\u304f\u65e5\u3060\u3063\u3051\uff1f", "\u305d\u3046\u305d\u3046\u3002\u4eca\u65e5\u306f\u3044\u3064\u3082\u3088\u308a\u91cf\u304c\u591a\u3044\u3089\u3057\u3044\u304b\u3089\u3001\u7814\u7a76\u54e1\u3082\u5009\u5eab\u306b\u5165\u308c\u308b\u306e\u624b\u4f1d\u3048\u3063\u3066\u6240\u9577\u304c\u8a00\u3063\u3066\u305f\u306d", "\u8377\u7269\u304c\u5c4a\u304f\u306e\u306f\u4f55\u6642\u9803\u304b\u3057\u3089\uff1f", "\u671d\u4e09\u3064\u306e\u9418\u306e\u9803\u3058\u3083\u306a\u3044\u304b\u306a\uff1f", "\u3058\u3083\u3042\u3001\u305d\u308c\u4f4d\u306b\u5009\u5eab\u524d\u306b\u884c\u3051\u3070\u3044\u3044\u304b\u306a", "\u3042\u308c\uff1f\u30bb\u30a4\uff1f", "\u30dd\u30fc\u30b7\u30e7\u30f3\u904b\u3093\u3067\u6765\u3066\u304f\u308c\u305f\u306e\uff1f", "\u306f\u3044", "\u7814\u7a76\u6240\u306e\u30dd\u30fc\u30b7\u30e7\u30f3\u3001\u307b\u3093\u3068\u6027\u80fd\u3044\u3044\u3088\u306a\u3002\u8a0e\u4f10\u306e\u3068\u304d\u3001\u672c\u5f53\u306b\u52a9\u304b\u308b", "\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u3044\u3064\u3082\u7d50\u69cb\u306a\u91cf\u3092\u4f5c\u3063\u3066\u3082\u3089\u3063\u3066\u308b\u3051\u3069\u3001\u5927\u5909\u306a\u3093\u3058\u3083\u306a\u3044\u304b\uff1f\u6b21\u306f\u3053\u306e\u500d\u3060\u308d\uff1f", "\u3048\uff1f\u5897\u3048\u308b\u3093\u3067\u3059\u304b\uff1f", "\u3042\u308c\uff1f\u805e\u3044\u3066\u306a\u3044\uff1f", "\u8907\u6570\u306e\u9a0e\u58eb\u56e3\u304c\u5408\u540c\u3067\u8a0e\u4f10\u3060\u306a\u3093\u3066\u3001\u5f37\u529b\u306a\u9b54\u7269\u3067\u3082\u51fa\u305f\u3093\u3067\u3059\u304b\uff1f", "\u305d\u3046\u3044\u3046\u8a33\u3067\u306f\u306a\u3044\u3093\u3060\u304c\u306a\u3002\u6b21\u306b\u884c\u304f\u306e\u304c\u30b4\u30fc\u30b7\u30e5\u306e\u68ee\u3060\u304b\u3089\u3001\u5ff5\u306e\u70ba\u3068\u3044\u3046\u3053\u3068\u3067\u4e8c\u3064\u306e\u9a0e\u58eb\u56e3\u304c\u51fa\u308b\u3053\u3068\u306b\u306a\u3063\u305f\u3093\u3060", "\u3042\u3041", "\u7b2c\u4e00\u9a0e\u58eb\u56e3\u306f\u884c\u304b\u306a\u3044\u3093\u3067\u3059\u304b\uff1f", "\u7b2c\u4e00\u306f\u6bbf\u4e0b\u9054\u306e\u304a\u5b88\u308a\u304c\u3042\u308b\u3093\u3060\u3088", "\u6bbf\u4e0b\uff1f", "\u3042\u30fc\u3001\u30ab\u30a4\u30eb\u6bbf\u4e0b\u9054\u304c\u6771\u306e\u68ee\u3067\u30ec\u30d9\u30eb\u4e0a\u3052\u3059\u308b\u3089\u3057\u304f\u3066\u306a\u3002\u305d\u306e\u8b77\u885b\u306b\u884c\u304f\u304b\u3089\u4eca\u56de\u306e\u8a0e\u4f10\u306b\u306f\u4e0d\u53c2\u52a0\u306a\u3093\u3060", "\u6bbf\u4e0b\u9054\u3082\u3082\u304615\u30ec\u30d9\u30eb\u306f\u8d85\u3048\u3066\u308b\u3060\u308d\u3002\u4eca\u66f4\u3001\u6771\u306e\u68ee\u3067\u30ec\u30d9\u30eb\u4e0a\u3052\u3057\u3066\u3082\u4e0a\u304c\u308a\u96e3\u3044\u3060\u308d\u3046\u306b\u2026\u2026", "\u305d\u3046\u3060\u306a\u3041\u3002\u884c\u304f\u306a\u3089\u5357\u306e\u68ee\u306e\u65b9\u304c\u826f\u3055\u305d\u3046\u3060\u3088\u306a", "\u8b77\u885b\u304c\u4ed8\u304f\u3093\u306a\u3089\u3001\u5c1a\u66f4\u5357\u306e\u68ee\u306e\u65b9\u304c\u3044\u3044\u3060\u308d", "\u3042\u308c\u3060\u308d\uff1f\u8056\u5973\u69d8\u304c\u3044\u308b\u304b\u3089\u3060\u308d", "\u307e\u3041\u3001\u5341\u4e2d\u516b\u4e5d\u305d\u3046\u3060\u308d\u3046\u306a\u3041", "\u8056\u5973\u69d8\uff1f", "\u6bbf\u4e0b\u304c\u4fdd\u8b77\u3057\u3066\u3044\u308b\u5973\u306e\u5b50\u3067\u3001\u6bbf\u4e0b\u9054\u304c\u305d\u3046\u547c\u3093\u3067\u308b\u3093\u3060\u3088", "\u968f\u5206\u5927\u5207\u306b\u3055\u308c\u3066\u308b\u3093\u3067\u3059\u306d\u3047", "\u3042\u3063\u3061\u306e\u8056\u5973\u69d8\u3088\u308a\u3001\u3088\u3063\u307d\u3069\u30bb\u30a4\u306e\u65b9\u304c\u8056\u5973\u69d8\u3063\u307d\u3044\u3051\u3069\u306a\u3041", "\u6bbf\u4e0b\u3082\u898b\u308b\u76ee\u306a\u3044\u3088\u306a", "\u4f55\u304b\u56f0\u3063\u305f\u3053\u3068\u304c\u3042\u3063\u305f\u3089\u8a00\u3048\u3088\u3002\u4ffa\u9054\u306b\u3067\u304d\u308b\u3053\u3068\u306a\u3089\u4f55\u3067\u3082\u3059\u308b\u304b\u3089", "\u3042\u306f\u306f\u3002\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059\u3002\u56f0\u3063\u305f\u3053\u3068\u304c\u3042\u3063\u305f\u3089\u76f8\u8ac7\u3055\u305b\u3066\u3082\u3089\u3044\u307e\u3059\u306d"]}
